import React, { useState } from 'react';
import { onboardEmployee } from '../services/api';

const OnboardingPage = () => {
    const [formData, setFormData] = useState({
        name: '', email: '', department: 'Engineering', age: '',
        totalExperience: '', pastExperience: '',
        dateJoined: new Date().toISOString().split('T')[0],
        dateOfBirth: '', status: 'ON_PROBATION'
    });
    const [error, setError] = useState('');
    const [success, setSuccess] = useState('');

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData((prev) => ({ ...prev, [name]: value }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');
        setSuccess('');

        try {
            const payload = { ...formData, age: parseInt(formData.age), totalExperience: parseInt(formData.totalExperience) };
            await onboardEmployee(payload);
            setSuccess(`Employee '${formData.name}' onboarded successfully!`);
            // Reset form
            setFormData({
                name: '', email: '', department: 'Engineering', age: '', totalExperience: '',
                pastExperience: '', dateJoined: new Date().toISOString().split('T')[0],
                dateOfBirth: '', status: 'ON_PROBATION'
            });
        } catch (err) {
            setError(err.response?.data || 'Failed to onboard employee. Please check all fields.');
        }
    };

    return (
        <div>
            <h2>Onboard New Employee</h2>
            <div className="form-container" style={{ maxWidth: '800px', margin: '2rem auto' }}>
                {error && <p className="error-message">{error}</p>}
                {success && <p className="success-message">{success}</p>}
                <form onSubmit={handleSubmit}>
                    <div style={{ display: 'flex', gap: '2rem' }}>
                        <div style={{ flex: 1 }}>
                            <div className="form-group"><label>Employee Name</label><input type="text" name="name" value={formData.name} onChange={handleChange} required /></div>
                            <div className="form-group"><label>Email</label><input type="email" name="email" value={formData.email} onChange={handleChange} required /></div>
                            <div className="form-group"><label>Department</label><select name="department" value={formData.department} onChange={handleChange}><option value="Engineering">Engineering</option><option value="HR">HR</option><option value="Marketing">Marketing</option><option value="Sales">Sales</option></select></div>
                            <div className="form-group"><label>Status</label><select name="status" value={formData.status} onChange={handleChange}><option value="ON_PROBATION">On Probation</option><option value="ACTIVE">Active</option></select></div>
                        </div>
                        <div style={{ flex: 1 }}>
                            <div className="form-group"><label>Age</label><input type="number" name="age" value={formData.age} onChange={handleChange} required /></div>
                            <div className="form-group"><label>Total Experience (years)</label><input type="number" name="totalExperience" value={formData.totalExperience} onChange={handleChange} required /></div>
                            <div className="form-group"><label>Date Joined</label><input type="date" name="dateJoined" value={formData.dateJoined} onChange={handleChange} required /></div>
                            <div className="form-group"><label>Date of Birth</label><input type="date" name="dateOfBirth" value={formData.dateOfBirth} onChange={handleChange} required /></div>
                        </div>
                    </div>
                    <div className="form-group"><label>Past Experience (Companies, Roles)</label><textarea name="pastExperience" value={formData.pastExperience} onChange={handleChange} /></div>
                    <button type="submit" className="btn">Complete Onboarding</button>
                </form>
            </div>
        </div>
    );
};

export default OnboardingPage;
